import React, { Component } from 'react';
import './App.css';
//import Header from './Header/Header'

class App extends Component{

  render() {
    return (
      <div>
      <h1>Привет, мир!</h1>
      <h2>Сейчас {this.props.date.toLocaleTimeString()}.</h2>
      </div>
    )
  }
}

export default App;
